import React from 'react';

function Login() {
  const [email, setEmail] = React.useState('');
  const [password, setPassword] = React.useState('');

  function handleSubmit(e) {
    e.preventDefault();
    if (!email || !password) {
      return;
    }
  }

  function handleChangeEmail(e) {
    setEmail(e.target.value);
  }

  function handleChangePassword(e) {
    setPassword(e.target.value);
  }

  return (
    <div className="login">
      <h2 className="login__title">Вход</h2>
      <form onSubmit={handleSubmit} className="login__form" name="login-form" noValidate>
        <input onChange={handleChangeEmail} value={email}
          className="login__input login__input_type_email" type="email" placeholder="Email"
          name="form-input-name" id="name-input" minLength="2" maxLength="40" required />
        <span className="login__error login-input-error"></span>
        <input onChange={handleChangePassword} value={password}
          className="login__input login__input_type_password" type="text" placeholder="Пароль"
          name="form-input-info" id="info-input" minLength="2" maxLength="200" required />
        <span className="login__error login-input-error"></span>
        <button disabled={!props.isBtnActive} className="login__btn" type="submit">Войти</button>
      </form>
    </div>
  );
}

export default Login;
